import React from "react";
import { BrowserRouter as Router, Route, Switch, Routes } from "react-router-dom";
import HomePage from "./Component/Home";
function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
      </Routes>
    </Router>
  );
}

export default App;
